import React , { Component } from 'react';
import './App.css';
import SignIn from './SignIn.js'

import { BrowserRouter as Router, Route } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Route exact path="/auth/" Component={SignIn}/>
        </div>
      </Router>
    );
  }
}

export default App;
